import "./Input.css"

const Input = (props) => {

    const onInputSubmit = (event) => {
        event.preventDefault();
    }
    return (
        <form onSubmit={onInputSubmit} class="input">
            <label htmlFor="input" className="input__label">Nieuwe activiteit</label>
            <input id="input" class="input__input" type="text" placeholder="Boodschappen..."></input>
        </form>
        
    );
}

export default Input;
